'26L' Kód lokality, kód identifikující lokalitu nebo geografickou oblast nebo přidruženou skupinu takových lokalit nebo oblastí, který má význam pro související transakci a který je v souladu s jednou nebo více strukturami definovanými v (a) až (f) níže:
a) dva velká písmena odpovídající dvoupísmennému kódu země ISO 3166-1 země, ve které se nachází nebo z které se skládá lokalita(y) nebo oblast(i);
b) tři velká písmena odpovídající kódu IATA letiště nebo města v, poblíž nebo z kterého se skládá lokalita(y) nebo oblast(i);
c) čtyři nebo více znaků, z nichž první tři odpovídají kódu země ISO 3166-1 následované pomlčkou (-), zbytek je poštovní směrovací číslo v dané zemi;
d) čtyři nebo více znaků, z nichž první tři odpovídají kódu země ISO 3166-1 následované tečkou (.), zbytek je kód subdivize země ISO 3166-2 v dané zemi;
e) pět velkých písmen odpovídajících kódu UN/LOCODE oblasti v, poblíž nebo z které se skládá lokalita(y) nebo oblast(i);
f) spojení, délka ne méně než sedm ani více než 35 znaků, z:
- kódu vydávající agentury ISO/IEC 15459;
- kódu lokality, skládajícího se ze znaků z množiny {A-Z; 0-9} který odpovídá specifikacím příslušné vydávající agentury.

