Identifikátor zařízení, jedná se o globálně unikátní identifikátor zařízení, položky zařízení nebo instance počítačové aplikace používané při výrobě, dopravě, zpracování nebo jiné manipulaci s položkami.

Kód místa UPU, kód identifikující místo nebo geografickou oblast, nebo přidruženou skupinu takových míst nebo oblastí, která má význam pro související transakci a která je v souladu s jednou ze struktur definovaných v a) až g) níže:
a) dvě velká písmena odpovídající dvoupísmennému kódu země ISO 3166-1 země, ve které se místo nebo oblast(i) nachází nebo se z ní skládá;
b) tři velká písmena odpovídající kódu IATA letiště nebo města v, blízko nebo zahrnujícího místo nebo oblast(i);
c) čtyři nebo více znaků, z nichž první tři odpovídají kódu země ISO 3166-1 následované pomlčkou (-), zbytek je poštovní směrovací číslo v příslušné zemi;
d) čtyři nebo více znaků, z nichž první tři odpovídají kódu země ISO 3166-1 následované tečkou (.), zbytek je kód subdivize země ISO 3166-2 v příslušné zemi;
e) pět velkých písmen odpovídajících kódu UN/LOCODE oblasti v, blízko nebo zahrnující místo nebo oblast(i);
f) šest velkých alfanumerických znaků odpovídajících kódu IMPC UPU přiděleného v souladu s UPU standardem S34;
g) spojení, v délce ne méně než sedmi ani více než 25 znaků, z:
 - kódu vydavatele přiděleného v souladu s UPU standardy S31;
 - kódu místa, skládajícího se ze znaků z množiny {A-Z; 0-9}, který je v souladu se specifikacemi vydavatele.

Číslo registrační značky s údaji o službě a kódem místa je složená datová konstrukce, v souladu se specifikací v UPU standardu S25, která zahrnuje specifikaci:
 - identifikátoru položky v souladu s ISO/IEC 15459;
 - specifikace služby, která má být poskytnuta v souvislosti s položkou, v souladu s datovým identifikátorem 5U;
 - kód místa UPU v souladu s datovým identifikátorem 17U nebo kvalifikovaný kód místa UPU v souladu s datovým identifikátorem 18U.
 Poznámka - Pro další podrobnosti viz UPU standard S25. Rozlišení mezi jednoduchým kódem místa UPU (DI 17U) a kvalifikovaným kódem místa UPU (DI 18U) lze určit z prvního znaku. Pokud je tento číselný, platí 18U; pokud je abecední, platí 17U.

