Datum, reprezentované v modifikované formě kompatibilní s UTC:
yyyy[mm[dd[hh[mm[ss[fff]]]]]][poooo] kde hranaté závorky značí volitelnost a yyyy je rok, mmdd měsíc a den, hhmmss čas dne v hodinách minutách a sekundách, fff jsou zlomky sekund a poooo je odchylka od UTC vyjádřená v hodinách a minutách, odchylka je kladná, pokud je p tečka (.), záporná, pokud je P mínus (-).
