- data, jehož formát a interpretace jsou v souladu se specifikacemi této vydávající agentury pro tento kvalifikátor data.

Prohlášení o kategorii obalového materiálu*, kódu* a hmotnosti pro daný obalový materiál použitý v daném obalu podle směrnice EU o obalech a obalových odpadech. (Kategorie materiálu a kód definován v příloze M).
12ECCMMMMMMNNNNNUU kde: - '12E' (an3) je identifikátor dat;
 - 'CC' (n2) je kategorie materiálu podle přílohy M;
 - 'MMMMMM' (an1...6) je kód materiálu podle přílohy M;
 - 'NNNNN' (n5) hmotnost materiálu, včetně desetinného bodu (např. 12.12);
 - 'UU' (an2) je jednotka míry pro hmotnost (např. KG, GR, LB nebo OZ podle ANSI X12.3 jak je uvedeno v příloze D).

