Číslo příjemce.
Unikátní identifikační číslo může být IRS, EIN, SSN nebo číslo přiřazené CBP, jak je vyžadováno na bezpečnostním hlášení. Používají se pouze následující formáty: IRS EIN: NN-NNNNNNN;
IRS EIN s příponou:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
CBP přiřazené č.: YYDDPP-NNNNN.
